"""# Preparing the Dataset"""

spam = pd.read_csv('/content/Data/spam_detection.csv')
spam.head()

spam.info()

spam.to_csv('fix_data/Fix_Data.csv', index=False)

"""# Set Variabel"""

PIPELINE_NAME = "spam-sms-pipeline"
SCHEMA_PIPELINE_NAME = "spam-sms-tfdv-schema"

PIPELINE_ROOT = os.path.join('irfan101019-pipelines', PIPELINE_NAME)

METADATA_PATH = os.path.join('metadata', PIPELINE_NAME, 'metadata.db')

SERVING_MODEL_DIR = os.path.join('serving_model', PIPELINE_NAME)

DATA_ROOT = "fix_data"

interactive_context = InteractiveContext(pipeline_root=PIPELINE_ROOT)

"""## Data ingestion menggunakan komponen CsvExampleGen()

Komponen ini dipilih karena dataset yang kita gunakan memiliki format CSV.
"""

output = example_gen_pb2.Output(
    split_config = example_gen_pb2.SplitConfig(splits=[
        example_gen_pb2.SplitConfig.Split(name="train", hash_buckets=8),
        example_gen_pb2.SplitConfig.Split(name="eval", hash_buckets=2)
    ])
)

example_gen = CsvExampleGen(input_base=DATA_ROOT, output_config=output)

interactive_context.run(example_gen)

"""## Membuat summary statistic

Pada latihan ini, kita akan membuat summary statistic menggunakan komponen StatisticsGen(). Komponen memiliki parameter input berupa examples untuk menerima dataset dari komponen ExampleGen.
"""

statistics_gen = StatisticsGen(examples=example_gen.outputs["examples"])

interactive_context.run(statistics_gen)

"""Anda dapat menggunakan interactive_context.show() untuk menampilkan summary statistic yang telah dibuat."""

interactive_context.show(statistics_gen.outputs["statistics"])

"""# Membuat data schema
Setelah membuat summary statistic, kita perlu membuat data schema. Pada latihan ini, kita menggunakan komponen ShcemaGen() untuk membuat data schema. Komponen ini akan menerima input berupa summary statistic.
"""

schema_gen = SchemaGen(statistics=statistics_gen.outputs["statistics"])

interactive_context.run(schema_gen)

interactive_context.show(schema_gen.outputs["schema"])

"""# Mengidentifikasi anomali pada dataset
Tahap selanjutnya adalah mengidentifikasi anomali pada dataset. Proses ini dilakukan menggunakan komponen ExampleValidator() yang telah disediakan oleh TFX. Komponen ini membutuhkan keluaran dari statistics_gen dan schema_gen sebagai parameter input.
"""

example_validator = ExampleValidator(
    statistics=statistics_gen.outputs['statistics'],
    schema=schema_gen.outputs['schema']
)
interactive_context.run(example_validator)

"""Untuk menampilkan hasil dari validasi dari komponen tersebut, kita bisa menjalankan kode berikut."""

interactive_context.show(example_validator.outputs['anomalies'])

